/* List 产品管理/产品列表 */

// ==================
// 所需的各种插件
// ==================

import React from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import P from 'prop-types';
import Config from '../../../../config/config';
import { Form, Button, Icon, Input,DatePicker, Table, message,InputNumber, Modal, Radio, Tooltip, Select, Cascader,Tabs, Divider ,Popover} from 'antd';
import './index.scss';
import tools from '../../../../util/tools'; // 工具
import Power from '../../../../util/power'; // 权限
import { power } from '../../../../util/data';
import _ from 'lodash';
// ==================
// 所需的所有组件
// ==================


// ==================
// 本页面所需action
// ==================

import { findAllProvince,findCityOrCounty,ServiceFlow,findSaleRuleByWhere,findProductTypeByWhere, findProductModelByWhere } from '../../../../a_action/shop-action';

// ==================
// Definition
// ==================
const FormItem = Form.Item;
const RadioGroup = Radio.Group;
const Option = Select.Option;
const { MonthPicker } = DatePicker;
const TabPane = Tabs.TabPane;
class Category extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            mode: 'top',
            data2: [], // 当前页面全部数据
            dataDetail:[] , // 分配详情全部数据
            productTypes: [],   // 所有的产品类型
            distributionTypes:[], //所有的分配类型
            productprice:'',  //产品的价格
            searchTypeId: undefined, // 搜索 - 类型名
            searchDistributionType: undefined, // 搜索 - 分配类型
            searchName: '', // 搜索 - 名称
            searchOrderId:'', // 搜索 - 订单号
            searchUserId:'', // 搜索 - 用户账号
            searchHraCardId:'', //搜索 - 体检卡号
            searchSerialNumber:'', // 搜索 - 流水号
            searchDistributorAccount:'', // 搜索 - 经销商账户
            searchMinPayTime:'' , //搜索 - 最小支付时间
            searchMaxPayTime:'' , //搜索 - 最大支付时间
            searchPayMonth:'' , //搜索 - 结算月份
            searchMinOrderFee:'' , //搜索 - 最小金额
            searchMaxOrderFee:'' , //搜索 - 最大金额
            searchAddress: [], // 搜索 - 地址
            addOrUp: 'add',     // 当前操作是新增还是修改
            addnewModalShow: false, // 添加新用户 或 修改用户 模态框是否显示
            addnewLoading: false, // 是否正在添加新用户中
            nowData: null, // 当前选中用户的信息，用于查看详情、修改、分配菜单
            queryModalShow: false, // 查看详情模态框是否显示
            pageNum: 1, // 当前第几页
            pageSize: 10, // 每页多少条
            total: 0, // 数据库总共多少条数据
            citys: [],  // 符合Cascader组件的城市数据

        };
    }

    componentDidMount() {
        if (!this.props.citys.length) { // 获取所有省，全局缓存
            this.getAllCity0();
        } else {
            this.setState({
                citys: this.props.citys.map((item, index) => ({ id: item.id, value: item.areaName, label: item.areaName, isLeaf: false})),
            });
        }
        this.getAllProductType();   // 获取所有的产品类型
        this.getAllDistributionType(); //获取所有的分配类型
        this.onGetData(this.state.pageNum, this.state.pageSize);
    }

    componentWillReceiveProps(nextP) {
        if(nextP.citys !== this.props.citys) {
            this.setState({
                citys: nextP.citys.map((item, index) => ({ id: item.id, value: item.areaName, label: item.areaName, isLeaf: false})),
            });
